import React, { Component } from 'react';

class Header extends Component {

    render() {
        return (
            <nav class="navbar navbar-dark bg-primary">
                <div class="navbar-nav">
                    <a class="nav-item nav-link active">ETF</a>
                </div>
            </nav>
        );
    }
}

export default Header;
